import React from 'react';

const Navbar = ({ setCurrentPage, onLogout }) => { 
    return ( 
        <nav className="bg-gradient-to-r from-green-600 to-green-800 p-4 shadow-lg rounded-b-lg"> 
            <div className="container mx-auto flex justify-between items-center"> 
                <h1 className="text-white text-3xl font-bold tracking-wide"><span className="text-green-200">Plan</span>MyPlate</h1> 
                <ul className="flex items-center space-x-6"> 
                    <li><button onClick={() => setCurrentPage('home')} className="text-white hover:text-green-200 transition duration-300 ease-in-out text-lg font-medium py-2 px-3 rounded-md hover:bg-green-700">Home</button></li> 
                    <li><button onClick={() => setCurrentPage('scanner')} className="text-white hover:text-green-200 transition duration-300 ease-in-out text-lg font-medium py-2 px-3 rounded-md hover:bg-green-700">Grocipes</button></li> 
                    <li><button onClick={() => setCurrentPage('food_db')} className="text-white hover:text-green-200 transition duration-300 ease-in-out text-lg font-medium py-2 px-3 rounded-md hover:bg-green-700">Food DB</button></li> 
                    <li><button onClick={() => setCurrentPage('profile')} className="text-white hover:text-green-200 transition duration-300 ease-in-out text-lg font-medium py-2 px-3 rounded-md hover:bg-green-700">Your Profile</button></li> 
                    <li><button onClick={onLogout} className="bg-red-500 hover:bg-red-600 text-white font-bold py-2 px-4 rounded-full text-sm transition duration-300">Logout</button></li> 
                </ul> 
            </div> 
        </nav> 
    ); 
};

export default Navbar;
